  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `tenant_id` int(11) DEFAULT '1' COMMENT '租户id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8mb4 COMMENT='quartz定时任务表';

